langManager:SetLangStr({
  ID = 9010000,
  TEXT = "A lend\195\161ria Na\195\167\195\163o das Mil Espadas possui ao centro uma enorme espada de pedra. E nesse momento centenas de disc\195\173pulos est\195\163o ajoelhados em frente a essa espada, e no topo est\195\161 o mestrer um poderoso e respeitado anci\195\163o."
})
langManager:SetLangStr({
  ID = 9010010,
  TEXT = "O mestre olha para o c\195\169u cheio de nuvens e pressente que tempos dif\195\173ceis vir\195\163o. E com um olhar triste e misericordioso ora para as pessoas comuns, pois sabe que esses n\195\163o ter\195\163o chances contra os dem\195\180nios que agora habitam essa terra."
})
langManager:SetLangStr({
  ID = 9010020,
  TEXT = "Essa nuvem negra que vem das terras de Sh\195\169n Zh\197\141u traz um cheiro m\195\179rbido, cheiro de dem\195\180nios. E esses dem\195\180nios s\195\163o t\195\163o arrogantes! Voc\195\170s est\195\163o preparados para mat\195\161-los ?"
})
langManager:SetLangStr({
  ID = 9010030,
  TEXT = "Mestre! N\195\163o se esque\195\167a de que somos disc\195\173pulos dessa na\195\167\195\163o. Sempre ajudaremos e defenderemos os fracos. Essa \195\169 nossa conduta como Espadachins. Estamos prontos e obedeceremos a suas ordens.."
})
langManager:SetLangStr({
  ID = 9010040,
  TEXT = "Muito bom saber que posso contar com voc\195\170s!"
})
langManager:SetLangStr({
  ID = 9010050,
  TEXT = "O mestre olha para o alto com olhos brilhantes, ergue sua m\195\163o direita e lan\195\167a um raio de luz, como uma espada que corta os c\195\169us."
})
langManager:SetLangStr({
  ID = 9010060,
  TEXT = "Estilha\195\167ar! "
})
langManager:SetLangStr({
  ID = 9010070,
  TEXT = "O mestre nesse momento lan\195\167a um de seus poderes supremos: O julgamento Divino. Uma for\195\167a Excepcional \195\169 lan\195\167ada e corta o c\195\169u. Uma energia azul clara forma uma grande espada que chega at\195\169 as nuvens."
})
langManager:SetLangStr({
  ID = 9010080,
  TEXT = "O poder lan\195\167ado pelo mestre destruiu a escurid\195\163o enviada pelos dem\195\180nios. O sol apareceu e iluminou toda a Na\195\167\195\163o."
})
langManager:SetLangStr({
  ID = 9010090,
  TEXT = "Jovens Espadachins sigam o meu comando. Nossa na\195\167\195\163o mantem o espirito de justi\195\167a e, portanto, ajudaremos as terras de Sh\195\169n Zh\197\141u aniquilando os dem\195\180nios."
})
langManager:SetLangStr({
  ID = 9010100,
  TEXT = "Sim senhor Mestre!"
})
langManager:SetLangStr({
  ID = 9100000,
  TEXT = "Os esp\195\173ritos envolvem as montanhas da Na\195\167\195\163o do Drag\195\163o Real. Nas montanhas seus lares foram constru\195\173dos em torno de um templo antigo no formato de uma cabe\195\167a de drag\195\163o."
})
langManager:SetLangStr({ID = 9100010, TEXT = "\194\183\194\183\194\183"})
langManager:SetLangStr({
  ID = 9100020,
  TEXT = "Em uma sala duas l\195\162mpadas de \195\179leo proporcionam ao local uma atmosfera um tanto quanto, misteriosa. "
})
langManager:SetLangStr({
  ID = 9100030,
  TEXT = "Na sala a Mestra aparece vestindo uma roupa m\195\161gica e se posiciona ao centro de um diagrama yin yang, ao redor desse diagrama h\195\161 seis anci\195\181es sentados."
})
langManager:SetLangStr({
  ID = 9100040,
  TEXT = "Bom senhores acredito que sabem do desastre ocorrido nas terras de Sh\195\169n Zh\197\141u. Li que \195\169 o l\195\173der dos imortais nos chama para ajud\195\161-los. O que voc\195\170s acham que devemos fazer?"
})
langManager:SetLangStr({
  ID = 9100050,
  TEXT = "Os seis anci\195\181es trocaram olhares entre si e ent\195\163o um deles disse: N\195\179s disc\195\173pulos dessa na\195\167\195\163o sempre fomos discretos e raramente interferimos em outros reinos. Por\195\169m, se as terras de Sh\195\169n Zh\197\141u est\195\163o passando por problemas \195\169 nosso dever ajudar. Afinal, muitos de nossos disc\195\173pulos aprimoraram suas habilidades nessas terras e se n\195\163o ajudarmos seremos ingratos."
})
langManager:SetLangStr({
  ID = 9100060,
  TEXT = "Ent\195\163o est\195\161 decidido. Escolham os magos que representar\195\161 nossa na\195\167\195\163o na grande Guerra das Sombras. Eles dever\195\163o partir em tr\195\170s dias."
})
langManager:SetLangStr({
  ID = 9100070,
  TEXT = "Os anci\195\181es se levantam e saem da sala.  "
})
langManager:SetLangStr({
  ID = 9100080,
  TEXT = "Ap\195\179s os anci\195\181es sa\195\173rem da sala, a mestra move suas m\195\163os suavemente e ent\195\163o, as l\195\162mpadas s\195\163o apagadas."
})
langManager:SetLangStr({
  ID = 9100090,
  TEXT = "Aos p\195\169s da mestra aparecem milagrosamente ondas de \195\161gua em formato de c\195\173rculo.."
})
langManager:SetLangStr({
  ID = 9100100,
  TEXT = "Essas ondas de \195\161gua come\195\167am a se mover cada vez mais r\195\161pido. Um espelho de \195\161gua surge e sobe parando em frente a Mestra.   "
})
langManager:SetLangStr({
  ID = 9100110,
  TEXT = "No espelho aparece a imagem da mestra, por\195\169m com roupas diferentes na cor vermelha. "
})
langManager:SetLangStr({
  ID = 9100120,
  TEXT = "A mestra fala com a pessoa do espelho:\"O problema que ocorre nas terras de sh\195\169n zh\197\141u n\195\163o tem nada a ver com a combina\195\167\195\163o de Drag\195\181es deste mundo."
})
langManager:SetLangStr({
  ID = 9100130,
  TEXT = "Ela continuou falando e a pessoa do espelho parece responder. "
})
langManager:SetLangStr({
  ID = 9100140,
  TEXT = "Cuidado com o que desejas, pois pode se realizar.    "
})
langManager:SetLangStr({
  ID = 9200000,
  TEXT = "O sol nascendo ao passar pelas \195\161rvores pinta um belo amanhacer."
})
langManager:SetLangStr({
  ID = 9200010,
  TEXT = "Enquanto na tribo uma antiga e tradicional cerim\195\180nia tem in\195\173cio."
})
langManager:SetLangStr({
  ID = 9200020,
  TEXT = "Uma mo\195\167\195\163 e um rapaz est\195\163o de joelhos em frente \195\160 mestra da Na\195\167\195\163o Lua."
})
langManager:SetLangStr({
  ID = 9200030,
  TEXT = "A mestra p\195\181e suas m\195\163os em cima da cabe\195\167a dos jovens orando:\"V\195\163o, meus filhos, como a \195\161guia que voa no c\195\169u ou o Leopardo que corre nas montanhas, sejam corajosos, pois um de voc\195\170s ser\195\161 o novo l\195\173der de nossa Na\195\167\195\163o Lua."
})
langManager:SetLangStr({
  ID = 9200040,
  TEXT = "Sigam para o leste, para as terras denominadas: terras de Sh\195\169n Zh\197\141u. Este \195\169 o primeiro destino de voc\195\170s. E a partir da\195\173 voc\195\170s devem trilhar  seus pr\195\179prios caminhos."
})
langManager:SetLangStr({
  ID = 9200050,
  TEXT = "Meus filhos, n\195\163o se sintam confusos por qualquer coisa, pois o destino ir\195\161 sempre gui\195\161-los."
})
langManager:SetLangStr({
  ID = 9200060,
  TEXT = "Sentar na grama e olhar as estrelas a noite, acalma o cora\195\167\195\163o. O ventinho que bate no rosto e o cheiro gostoso da grama criam um belo ambiente. Os jovens se sentam lado a lado e olham maravilhados para as estrelas no c\195\169u."
})
langManager:SetLangStr({
  ID = 9200070,
  TEXT = "Amanh\195\163 partiremos para as terras de Sh\195\169n Zh\197\141u."
})
langManager:SetLangStr({
  ID = 9200080,
  TEXT = "Ouvi dizer que os animais est\195\163o sofrendo nas m\195\163os dos dem\195\180nios. Tudo est\195\161 um caos!"
})
langManager:SetLangStr({
  ID = 9200090,
  TEXT = "Com certeza esse ser\195\161 o nosso teste. Est\195\161 com medo?"
})
langManager:SetLangStr({
  ID = 9200100,
  TEXT = "Claro que n\195\163o! Com meu arco na m\195\163o os monstros nem conseguir\195\163o chegar perto de mim."
})
langManager:SetLangStr({
  ID = 9200110,
  TEXT = "A mestra disse que devemos seguir caminhos diferentes quando chegarmos as terras de Sh\195\169n Zh\197\141u. Preciso que me prometas que tomar\195\161 cuidado e n\195\163o se deixar\195\161 ferir por esses dem\195\180nios."
})
langManager:SetLangStr({
  ID = 9200120,
  TEXT = "Ah para! Eu sei tomar conta de mim. Voc\195\170 est\195\161 parecendo o meu pai falando desse jeito. Voc\195\170 me chamou aqui a meia noite apenas para me dizer isso?"
})
langManager:SetLangStr({ID = 9200130, TEXT = "N\195\163o."})
langManager:SetLangStr({
  ID = 9200140,
  TEXT = "Ent\195\163o fale!"
})
langManager:SetLangStr({
  ID = 9200150,
  TEXT = "O que... Hum... O que esperas que eu diga?"
})
langManager:SetLangStr({
  ID = 9200160,
  TEXT = "Diga o que voc\195\170 queria me dizer."
})
langManager:SetLangStr({
  ID = 9200170,
  TEXT = "Que... Hum... Aceita ser minha namorada quando isso tudo acabar?"
})
langManager:SetLangStr({
  ID = 9200180,
  TEXT = "Bobo! Aceito."
})
langManager:SetLangStr({
  ID = 9400000,
  TEXT = "A Floresta de Jade Verde \195\169 um dos lugares mais misteriosos da Colina Verde, t\195\170m muitas \195\161rvores, folhas verdes... Na sombra das \195\161rvores, tem duas belas mo\195\167as que conversam. Uma est\195\161 com roupa vermelha igual ao fogo e a outra com roupa roxa. Ambas muito charmosas."
})
langManager:SetLangStr({
  ID = 9400010,
  TEXT = "Voc\195\170 deve est\195\161 muito feliz, pois foi \195\160 escolhida para nos representar na Guerra das Sombras."
})
langManager:SetLangStr({
  ID = 9400020,
  TEXT = "Mais ou menos!  Vivo aqui h\195\161 mais de cem anos, nunca tive curiosidade de ir ao mundo dos humanos."
})
langManager:SetLangStr({
  ID = 9400030,
  TEXT = "Aham! Sei!  Tome cuidado nas terras de Sh\195\169n Zh\197\141u. Os nove dem\195\180nios reis s\195\163o muitos perigosos."
})
langManager:SetLangStr({
  ID = 9400040,
  TEXT = "Eu n\195\163o mexerei com eles, desde que, eles n\195\163o mexam comigo."
})
langManager:SetLangStr({
  ID = 9400050,
  TEXT = "Lembre-se! Se encontrar aquela pessoa, n\195\163o se aproxime. Ele.... mudou totalmente."
})
langManager:SetLangStr({
  ID = 9400060,
  TEXT = "Sim. Mas, eu irei sozinha?"
})
langManager:SetLangStr({
  ID = 9400070,
  TEXT = "V\195\161 \195\160 frente. O povo da  nossa Na\195\167\195\163o ir\195\161 encontr\195\161-la nas terras de Sh\195\169n Zh\197\141u. V\195\161 antes que fique tarde."
})
langManager:SetLangStr({
  ID = 9400080,
  TEXT = "Estou indo."
})
langManager:SetLangStr({
  ID = 9400090,
  TEXT = "Que os deuses tome conta de voc\195\170!"
})
langManager:SetLangStr({
  ID = 9400100,
  TEXT = "Aquela pessoa... errgrrr."
})
langManager:SetLangStr({
  ID = 9300000,
  TEXT = "N\195\163o sei onde fica esse sal\195\163o misterioso em ru\195\173nas, com colunas quebradas cheio de rachaduras que ilustram um grande desastre. A luz do sol que adentra o local por um telhado quebrado ilumina o rosto furioso de um dem\195\180nio de seis bra\195\167os. E h\195\161 um homem forte que carrega uma foice e est\195\161 sentado \195\160 frente do dem\195\180nio. A sua m\195\163o esquerda estava firmemente selada com correntes."
})
langManager:SetLangStr({
  ID = 9300010,
  TEXT = "Voc\195\170 veio me procurar porque est\195\161s preparado para ir as terras de Sh\195\169n Zh\197\141u lutar na grande Guerra das Sombras?"
})
langManager:SetLangStr({
  ID = 9300020,
  TEXT = "Eu nunca me preparo para matar os dem\195\180nios.J\195\161 nasci preparado!"
})
langManager:SetLangStr({
  ID = 9300030,
  TEXT = "Os inimigos de agora n\195\163o s\195\163o iguais aos que voc\195\170 matou antes, eles s\195\163o muito mais cru\195\169is."
})
langManager:SetLangStr({
  ID = 9300040,
  TEXT = "N\195\163o importa!Usarei minha foice afiada para cortar a garganta de qualquer dem\195\180nio."
})
langManager:SetLangStr({
  ID = 9300050,
  TEXT = "Excelente! O exorcista necessita ter esse espirito. Agora irei lhe ensinar a nossa t\195\169cnica mais poderosa. Observe!"
})
langManager:SetLangStr({
  ID = 9300060,
  TEXT = "O Mestre ao enfrentar o dem\195\180nio levanta sua foice para o alto, enquanto sua l\195\161mina brilha! "
})
langManager:SetLangStr({
  ID = 9300070,
  TEXT = "Terra!\"\n A terra treme, e em sua volta surgem fissuras do ch\195\163o!"
})
langManager:SetLangStr({
  ID = 9300080,
  TEXT = "Ce\195\186!\"\n O espirito da justi\195\167a surge do corpo do exorcista dan\195\167ando como um vento forte!"
})
langManager:SetLangStr({
  ID = 9300090,
  TEXT = "De repente ele grita, e sua voz ecoa como um trov\195\163o que rasga o c\195\169u em noites de tempestade, e as correntes do seu bra\195\167o s\195\163o quebradas!"
})
langManager:SetLangStr({
  ID = 9300100,
  TEXT = "Espirito Ceifador de Almas!"
})
langManager:SetLangStr({
  ID = 9300110,
  TEXT = "Com um movimento descendente, uma lamina espiritual acerta seu inimigo dilascerando seu corpo."
})
langManager:SetLangStr({
  ID = 9300120,
  TEXT = "Que poder terr\195\173vel! Uma forte energia \195\169 liberada deixando o inimigo e at\195\169 mesmo, a parede em peda\195\167os. "
})
langManager:SetLangStr({
  ID = 9300130,
  TEXT = "Voc\195\170 j\195\161 possui o poder do Espirito Ceifador de Almas em seu sangue, por\195\169m s\195\179 quando superar os limites de suas habilidades ser\195\161 capaz de dominar esse poder."
})
langManager:SetLangStr({
  ID = 9300140,
  TEXT = "Ent\195\163o este \195\169 o momento que nos despedimos para sempre!"
})
langManager:SetLangStr({
  ID = 9300150,
  TEXT = "Sim, pois estou morrendo. O poder do espirito est\195\161 consumindo o meu corpo. Mas isso n\195\163o importa. H\195\161 anos convivo com essa maldi\195\167\195\163o do Golen do Caos que faz os exorcistas enfrentarem dia ap\195\179s dia esse destino sombrio que n\195\163o \195\169 a morte e sim nos transformar em monstros pouco a pouco. "
})
langManager:SetLangStr({
  ID = 9300160,
  TEXT = "Mas n\195\163o existe uma forma de quebrar a maldi\195\167\195\163o?"
