langManager:SetLangStr({
  ID = 9300170,
  TEXT = "Sim, h\195\161 uma forma, mas para isso \195\169 preciso que voc\195\170 encontre nosso cl\195\163 quando chegar nas terras de Sh\195\169n Zh\197\141u. E l\195\161 quebre essa maldi\195\167\195\163o que nos atormenta por longos anos."
})
langManager:SetLangStr({
  ID = 9300180,
  TEXT = "Voc\195\170 tem algum desejo?"
})
langManager:SetLangStr({
  ID = 9300190,
  TEXT = "Tenho! Banhe sua foice com o sangue dos dem\195\180nios, use a for\195\167a dos Exorcistas para por medo e causar pesadelos nos dem\195\180nios! Fa\195\167a a nossa lenda renascer e ser conhecida em todo o mundo."
})
langManager:SetLangStr({
  ID = 9300200,
  TEXT = "Sim, farei o que me pedes. Partirei ent\195\163o!"
})
