langManager:SetLangStr({
  ID = 9900160,
  TEXT = "Seu monstro Insolente, o s\195\161bio drag\195\163o imperial n\195\163o favoreceu ao drag\195\163o misterioso, voc\195\170 se exp\195\180s ao erro, atreva a agir com viol\195\170ncia aqui!"
