langManager:SetLangStr({
  ID = 11004000,
  TEXT = [[
Saltar parado/saltar caminhando Z

 corte e golpe durante o estado de saltar/caminhar e saltar; golpes adicionais no inimigo flutuante.]]
})
langManager:SetLangStr({
  ID = 11005000,
  TEXT = "Saltar parado/saltar caminhando + X\n\n somente iniciar\"Agregados espirituais\"Dispon\195\173vel para uso ap\195\179s: desferir golpe da espada espiritual em estado de saltar parado/saltar caminhando; golpes adicionais no inimigo flutuante."
})
langManager:SetLangStr({
  ID = 11006000,
  TEXT = "Saltar correndo + Z + Z + Z\n\n cortes sucessivos em tr\195\170s etapas e golpe em estado de saltar correndo; golpeia o inimigo na etapa final."
})
langManager:SetLangStr({
  ID = 11007000,
  TEXT = [[
