})
langManager:SetLangStr({
  ID = 11008000,
  TEXT = "Ca\195\173do no ch\195\163o +Z/X\n\n levantar-se para golpear os inimigos em torno de si e derrub\195\161-los."
})
langManager:SetLangStr({
  ID = 11009000,
  TEXT = "Ca\195\173do no ch\195\163o + \226\134\144/\226\134\146\n\n rolar para a esquerda e para a direita em estado de queda, para escapar da posi\195\167\195\163o original e evitar a persegui\195\167\195\163o pelo inimigo."
})
langManager:SetLangStr({
  ID = 11010000,
  TEXT = "Deriva\195\167\195\163o do ataque geral Z, o golpe final se transforma no golpe voador de rajada. \n deriva\195\167\195\163o da chave: Z\194\183Z\194\183Z\194\183X\n\n"
})
langManager:SetLangStr({
