  TEXT = "Deriva\195\167\195\163o do ataque geral X, o golpe final se transforma no golpe flutuante. \n deriva\195\167\195\163o da chave: X\194\183X\194\183Z\n\n"
})
langManager:SetLangStr({
  ID = 11012000,
  TEXT = "Manobra\n ataca os inimigos em torno de si, enquanto aumenta o dano. \n digitar comando: ZXC\n\n pode ser iniciado quando o tanque de f\195\186ria estiver cheio. Z+X+C s\195\163o pressionados simultaneamente, aumentando em 20% as artes marciais e o poder de ataque m\195\161gico, com dura\195\167\195\163o de 30 segundos."
})
langManager:SetLangStr({
  ID = 11013000,
  TEXT = "Manobra\n pequeno salto para tr\195\161s. \n digitar comando: \226\134\147 + ZX\n\n"
})
langManager:SetLangStr({
  ID = 11014000,
  TEXT = "Manobra \n espadachim contra-atacando, contando com vasta experi\195\170ncia de combate no momento em que o inimigo ataca, rompendo a postura do inimigo.  \n tecla de habilidade espec\195\173fica de profiss\195\163o: V\n\n causou 200% de dano.  \n consumo de vitalidade: 57"
